    def select_all(self):
        for i in range(len(self.vars)):
            self.vars[i].set(True)
            if i not in self.listbox.curselection():
                self.listbox.selection_set(i)

    def select_range(self):
        try:
            from_val = int(self.range_from_var.get()) - 1  # Convert to 0-based index
            to_val = int(self.range_to_var.get()) - 1      # Convert to 0-based index
            
            # Validate range
            from_val = max(0, from_val)  # Don't go below 0
            to_val = min(len(self.vars) - 1, to_val)  # Don't exceed total items
            
            if from_val > to_val:
                # Swap if from is greater than to
                from_val, to_val = to_val, from_val
            
            # First, deselect all
            for i in range(len(self.vars)):
                self.vars[i].set(False)
                if i in self.listbox.curselection():
                    self.listbox.selection_clear(i)
            
            # Then select the range
            for i in range(from_val, to_val + 1):
                self.vars[i].set(True)
                if i not in self.listbox.curselection():
                    self.listbox.selection_set(i)
                    
        except ValueError:
            # Handle invalid input - just ignore
            pass

    def deselect_all(self):
        for i in range(len(self.vars)):
            self.vars[i].set(False)
            if i in self.listbox.curselection():
                self.listbox.selection_clear(i)

    def import_selected(self):
        # Store the selection before destroying the dialog
        selected_indices = self.listbox.curselection()
        self._final_selection = []
        for idx in selected_indices:
            if 0 <= idx < len(self.link_data):
                self._final_selection.append(self.link_data[idx])
        
        # Update vars based on actual listbox selection
        for i in range(len(self.vars)):
            self.vars[i].set(i in selected_indices)
        self.top.destroy()

    def get_selected(self):
        # Return the stored selection (if Import Selected was clicked)
        # or empty list (if Cancel was clicked)
        return self._final_selection if self._final_selection is not None else []


