    def open_fitgirl_page(self):
        url = self.fitgirl_base_var.get().strip()
        if not url:
            messagebox.showerror("Error", "Please enter a FitGirl Base URL first")
            return
        if not url.startswith("http"):
            url = "https://" + url

        try:
            r = requests.get(url, timeout=30)
            r.raise_for_status()
            html = r.text
            links = self.extract_links_from_page(html)
            self.add_extracted_links(links)
        except Exception as e:
            messagebox.showerror("Error", f"Failed to fetch page: {e}")

    def extract_links_from_page(self, html):
        soup = BeautifulSoup(html, "html.parser")
        links = []
        for a in soup.find_all("a", href=True):
            href = a["href"]
            text = a.get_text(strip=True)
            if "fuckingfast.co" in href and "#" in href:
                links.append((text, href))
        return links

    def add_extracted_links(self, links):
        if not links:
            messagebox.showinfo("No New Links", "No new FitGirl links found")
            return

        # Store all fetched links grouped by game name for accurate tracking
        from config_manager import store_fetch_data
        fetch_groups = store_fetch_data(links)
        
        print(f"DEBUG: Fetch grouped into {len(fetch_groups)} game groups:")
        for group_name, group_data in fetch_groups.items():
            print(f"  {group_name}: {group_data['total_parts']} parts")

        # Show selection dialog
        dialog = LinkSelectionDialog(self.root, links)
        self.root.wait_window(dialog.top)
        selected = dialog.get_selected()
        if not selected:
            return
        # Start background thread to resolve links
        self.set_status("Resolving selected links...")
        threading.Thread(target=self._resolve_and_add_links, args=(selected, len(links)), daemon=True).start()

    def _resolve_and_add_links(self, selected, total_available):
        """Resolve each selected link to real /dl/ link in background thread"""
        resolved_links = []
        total = len(selected)
        
        print(f"DEBUG: Resolving {len(selected)} selected links out of {total_available} total available")
        
        for i, (text, href) in enumerate(selected):
            try:
                self.set_status(f"Resolving link {i+1}/{total}: {text[:50]}...")
                real_dl = self.extract_real_download_link(href)
                if real_dl:
                    resolved_links.append((text, real_dl))
            except Exception as e:
                print(f"Failed to resolve {href}: {e}")

        # Update UI in main thread
        self.root.after(0, lambda: self._add_resolved_links(resolved_links, total_available))

