    def open_cached_data(self):
        """Open the config.json file with the system's default application"""
        try:
            import subprocess
            import os
            import platform
            
            config_file = "config.json"
            
            # Check if config file exists
            if not os.path.exists(config_file):
                messagebox.showerror("Error", f"Config file '{config_file}' not found!")
                return
            
            # Get the absolute path
            abs_path = os.path.abspath(config_file)
            
            # Open with system default application based on platform
            system = platform.system()
            if system == "Windows":
                os.startfile(abs_path)
            elif system == "Darwin":  # macOS
                subprocess.run(["open", abs_path])
            else:  # Linux
                subprocess.run(["xdg-open", abs_path])
                
        except Exception as e:
            messagebox.showerror("Error", f"Failed to open config file: {e}")

