    def all_downloads_complete(self):
        """Check if all downloads are complete and 100%"""
        if not self.links:
            return False
        
        # Check if all URLs have status "completed"
        for url in self.links:
            if self.url_status.get(url) != "completed":
                return False
        
        # Check if all progress bars are at 100%
        for item in self.url_items:
            if 'progress' in item:
                try:
                    max_val = float(item['progress']["maximum"])
                    current_val = float(item['progress']["value"])
                    if max_val > 0 and current_val < max_val:
                        return False
                except:
                    return False
        
        return True

    def check_and_trigger_auto_extract(self):
        """Check if auto-extraction should be triggered based on multiple sources"""
        # Trigger auto-extraction check in extractor tab
        if hasattr(self, 'extractor_tab'):
            self.extractor_tab.check_downloads_and_extract()

    def clean_archive_name(self, archive_name):
        """Remove numbering and clean up archive name for folder creation"""
        # Remove common numbering patterns
        name = archive_name
        
        # Remove .part001, .part01, _part001, _part01, etc.
        name = re.sub(r'[._]part\d+$', '', name, flags=re.IGNORECASE)
        
        # Remove just numbers at the end if they look like part numbers
        name = re.sub(r'\d+$', '', name)
        
        # Clean up any remaining special characters and spaces
        name = re.sub(r'[._]+', ' ', name)  # Replace dots and underscores with spaces
        name = re.sub(r'\s+', ' ', name)   # Replace multiple spaces with single space
        name = name.strip()               # Remove leading/trailing spaces
        
        # If name is empty after cleaning, use a default
        if not name:
            name = "Extracted_Archive"
            
        return name

    def browse_download_dir(self):
        folder = filedialog.askdirectory(title="Select Download Folder")
        if not folder:
            return
        try:
            p = Path(folder)
            p.mkdir(parents=True, exist_ok=True)
            self.download_dir = p
            self.download_dir_var.set(str(p.resolve()))
            # Save to config
            set_setting("download_directory", str(p.resolve()))
            
            # Update extractor tab's default paths
            if hasattr(self, 'extractor_tab') and self.extractor_tab:
                self.extractor_tab.update_paths_from_download_dir()
        except Exception as e:
            messagebox.showerror("Error", f"Failed to set download folder: {e}")

    def set_status(self, text):
        # Make "resolving" text red
        if "resolving" in text.lower():
            fg_color = "red"
        else:
            fg_color = "black"
            
        if threading.current_thread() is threading.main_thread():
            self.status.config(text=text, fg=fg_color)
        else:
            self.root.after(0, lambda t=text: self.status.config(text=t, fg=fg_color))

    def set_progress(self, maximum=None, value=None):
        if not hasattr(self, "progress"):
            return

        def _apply(maximum_v, value_v):
            if maximum_v is not None:
                self.progress["maximum"] = maximum_v
            if value_v is not None:
                self.progress["value"] = value_v

        if threading.current_thread() is threading.main_thread():
            _apply(maximum, value)
        else:
            self.root.after(0, lambda m=maximum, v=value: _apply(m, v))

    def set_url_progress(self, url, maximum=None, value=None):
        def _apply():
            for item in self.url_items:
                if item.get('url') == url and 'progress' in item:
                    if maximum is not None:
                        item['progress']["maximum"] = maximum
                    if value is not None:
                        item['progress']["value"] = value
                    if 'percent_label' in item:
                        try:
                            m = float(item['progress']["maximum"])
                            v = float(item['progress']["value"])
                            pct = int((v / m) * 100) if m > 0 else 0
                        except Exception:
                            pct = 0
                        item['percent_label'].config(text=f"{pct}%")
                    break

        if threading.current_thread() is threading.main_thread():
            _apply()
        else:
            self.root.after(0, _apply)

    def set_url_status(self, url, status):
        def _apply():
            for item in self.url_items:
                if item.get('url') == url and 'status_label' in item:
                    item['status_label'].config(text=status)
                    break

        if threading.current_thread() is threading.main_thread():
            _apply()
        else:
            self.root.after(0, _apply)

