    def paste_urls(self, event=None):
        try:
            clipboard_text = self.root.clipboard_get()
            urls = [url.strip() for url in clipboard_text.split("\n") if url.strip()]
            new_urls = []
            url_to_filename = {}
            
            for url in urls:
                if url not in self.links:
                    self.links.append(url)
                    self.url_status[url] = "pending"
                    self.download_states[url] = {"paused": False, "thread": None, "stop_event": threading.Event()}
                    self.add_url_item(url)
                    new_urls.append(url)
                    # For pasted URLs, extract filename from URL (no original page info available)
                    filename = url.split('/')[-1].split('#')[0]
                    url_to_filename[url] = filename
            
            if urls:
                print(f"About to call confirm_and_clear_json for {len(urls)} pasted URLs")
                # Ask user about clearing previous session data
                self.confirm_and_clear_json()
                
                # Track the imported URLs with extracted filenames FIRST
                add_imported_urls(new_urls, url_to_filename)
                # THEN update the filename labels in the UI
                self.update_filename_labels(new_urls, url_to_filename)
                messagebox.showinfo("Success", f"Added {len(urls)} URLs to list")
        except:
            pass  # No clipboard content or error
    
